class Rules:
    def __init__(self):
        self.rules = []
        self.index=0

    def build_rules(self,index,lhs,rhs):
        return f"rewrite!(\"rule_{index}\"; \"{lhs}\" => \"{rhs}\"),"

    def gen_file(self,valid_group,file_path):
        assert(max(valid_group)<len(self.rules))
        with open(file_path, "w") as file:
            file.write(file_str1)
            # Loop through each string in the list
            for index in valid_group:
                for rule in self.rules[index]:
                    file.write("        "+rule + "\n")
            file.write(file_str2)
        return

    
    def update(self,rule):
        rule_index=[]
        rule_group=[]
        for i in rule:
            assert(len(i)==2 and isinstance(i[0], str) and isinstance(i[1], str))
            rule_index.append(len(self.rules))
            self.index+=1
            rule_group.append(self.build_rules(self.index,i[0],i[1]))
        self.rules.append(rule_group)

    def update_batch(self,rule_batch):
        for i in rule_batch:
            self.update(i)
            
